def shifted_gm(soln_times):
	shift = 10.0

	num_instances = len(soln_times)
	result = 0.0
	for i in range(num_instances):
		result += math.log(max(1, soln_times[i]+shift))
	result = math.exp(result/num_instances) - shift

	return result




